  constructor(props) {
    super(props);
    this.state = {
      users: [
        {
          id: 346364,
          name: 'Chance Lipshutz',
          school: 'California College of the Arts',
          major: 'Illustration',
          Year: 2020,
          Portfolio: [{ img: [], desc: '' }],
        },
      ],
    };
  }
  render() {
    return (
      <div className="App">
        <Nav />
        <Search />
        <PortfolioCard userName="Chance Lipshutz" />
      </div>
    );
  }
}

export default App;
